package com.example.prescription_module.domain;import jakarta.persistence.*;import lombok.Getter;@Getter@Entitypublic class MedicalHistory {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    private Long idPatient;    private String disease;    public MedicalHistory() {    }    public MedicalHistory(Long id, Long idPatient, String disease) {        this.id = id;        this.idPatient = idPatient;        this.disease = disease;    }    public void setId(Long id) {        this.id = id;    }    public void setIdPatient(Long idPatient) {        this.idPatient = idPatient;    }    public void setDisease(String disease) {        this.disease = disease;    }}